import { useState, useEffect } from "react";
import axios from "axios";

const App = (props) => {
  const [playersList, setPlayersList] = useState([]);

  let players = [];

  useEffect(() => {
    async function getTeams() {
      axios
        .get("/getData", { params: { year: 2021, manager: "BillDaly" } })
        .then((res) => {
          res.data.map((e) =>
            players.push({ name: e.player_name, manager: e.manager })
          );
          setPlayersList(players);
        });
    }
    getTeams();
  }, []);
  console.table(playersList);

  return (
    <div>
      <select id="ft-year-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <select id="ft-team-select">
        <option default value="#">
          Select a Team
        </option>
      </select>
      <button>Click Me</button>
      <table>
        <thead>
          <tr>
            <th>Manager</th>
            <th>Player</th>
          </tr>
        </thead>
        <tbody>
          {playersList.map((e, i) => {
            return [
              <tr>
                <td key={i + e.manager}>{e.manager}</td>
                <td key={i + e.name}>{e.name}</td>
              </tr>,
            ];
          })}
        </tbody>
      </table>
    </div>
  );
};

export default App;
